import React, { useState } from "react";

const SearchResult=(props)=>{
    const img = `https://source.unsplash.com/?${props.name}`;
    return(
       <>
      <div>
          <img src={img} alt="image"/>
      </div>
       </>
    )
}
export default SearchResult;
